export const PostCard = (props) => {
    return ( 
        <div className="post">
            <img src={p.cover} alt={post.title}/>
            <div key={post.id} className="post-texts">
              <h1>{post.title}</h1>
              <p>{post.body}</p>
            </div>
        </div>
     );
}
